    b a b a d
0 b 1 0 1 0 0
1 a   1 0 1 0
2 b     1 0 0
3 a       1 0
4 d         1

class Solution {
    public String longestPalindrome(String s) {
        if(s == null || s.length() == 0)
            return "";
        int n = s.length();
          //initialize
        String res = "";
        boolean[][] dp = new boolean[n][n];
          //DP Matrix, from bottom to up
        for(int i = n - 1; i >= 0; i--) {
            for(int j = i; j  res.length())
                    res = s.substring(i, j + 1);
            }
        }
        return res;
    }
}

Complexity Analysis

Time Complexity: O(n^2)
Space Complexity: O(n^2)

